    <script>
        $('#editProfileForm').validate(
            {
                ignore: '',
                rules: {
                    client_id: {
                        required: true,
                        noSpace: true,
                    },
                    secret_id: {
                        required: true,
                        noSpace: true,
                    }
                },
                errorPlacement: function (error, element) {
                    // console.log(element.attr("name"));
                    if (element.attr("name") === "city_id") {
                        // error.insertAfter(element.parent());
                        $("#city").html(error);
                    } else {
                        error.insertAfter(element);
                    }
                }
            }
        );
    </script>
    <script>

        $(document).ready(function () {
            var url_string = window.location.href;
            var url = new URL(url_string);

            var paramValue = url.searchParams.get("page");
            if (paramValue) {
                var pag = paramValue;
            } else {
                var pag = 1;
            }

            $(document).on('click', "#payment_info", function () {
                window.location.href = '?payment_info=' + true + '&page=' + pag;
            });

            $(document).on('click', "#payment_profile", function () {
                window.location.href = '?payment_profile=' + true;
            });

            $(document).on('click', "#withdraw_request", function () {
                window.location.href = '?withdraw_request=' + true;
            });
        });

        $(`#withdrawForm`).validate({
            submitHandler: function (form) {
                form.submit();
            }
        });

        $("#withdrawForm").validate({
            rules: {
                amount: {
                    min: 1
                },
                messages: {
                    amount: {
                        min: "Value must be greater than 0"
                    }
                }
            },
            errorPlacement: function (error, element) {
                // console.log(element.attr("name"));
                if (element.attr("name") === "city_id") {
                    // error.insertAfter(element.parent());
                    $("#city").html(error);
                } else {
                    error.insertAfter(element);
                }
            }

        });

    </script>
